// client/src/components/Navbar.js
import React from 'react';

const Navbar = () => {
    return (
        <nav className="fixed top-4 left-1/2 transform -translate-x-1/2 z-50 bg-gray-800 bg-opacity-70 backdrop-blur-md rounded-full px-8 py-3 flex justify-between items-center shadow-lg">
            <div className="flex items-center">
                <img src="/assets/logo.png" alt="TourBuzz" className="h-10 mr-4" />
                <span className="text-white text-xl font-bold">TourBuzz</span>
            </div>
            <ul className="flex space-x-6">
                <li><a href="#home" className="text-white hover:text-orange-500">Home</a></li>
                <li><a href="#tours" className="text-white hover:text-orange-500">Tours</a></li>
                <li><a href="#about" className="text-white hover:text-orange-500">About Us</a></li>
                <li><a href="#contact" className="text-white hover:text-orange-500">Contact</a></li>
            </ul>
        </nav>
    );
}

export default Navbar;
